import React, { Component } from "react";
import "./login.css";

class Signin extends Component {
  // initiate state
  //  constructor(props) {
  //     super(props);
  //     this.state = {
  //       username: 'username',
  //       password: 'password',
  //     }
  //   }

  render() {
    return (
      <div className="login">
        <h4>Login</h4>
        <form>
          <div className="text_area">
            <input
              type="text"
              id="username"
              name="username"
              defaultValue="username"
              className="text_input"
            />
          </div>
          <div className="text_area">
            <input
              type="password"
              id="password"
              name="password"
              defaultValue="password"
              className="text_input"
            />
          </div>
          <input type="submit" value="LOGIN" className="btn" />
        </form>
        <a className="link" href="/signup">
          Sign Up
        </a>
      </div>
    );
  }
}

export default Signin;
